                'link' => 'https://www.linkedin.com/feed/update/urn:li:activity:7194780494419423232',
                'description' => 'It was wonderful to be in Lagos, Nigeria this past week to give a keynote at the first annual ProcessMaker Nigerian Partner and Customer summit.¬†We held the event at the Radisson Blu in Victoria Island and hosted close to 75 customers and partners over the two day event.¬†  Thanks to my good friend and our Executive Director of Africa, Ed Ukaonu, and our Nigerian team Samuel Gbadebo, Jeremiah Davies, and Bamgboye Ayodele, BCS, MBA.   I would also like to give a special thanks to Rear Admiral Alison Madueke for his presence at the event.

