The African banking sector is one of the fastest moving, fastest growing, and most innovative banking sectors in the world today, and ProcessMaker is proud to be contributing to that speed of innovation.

At the event we were thrilled to showcase ProcessMaker‚Äôs latest release which includes ProcessMaker AI which can now build forms, scripts, and process models from simple text descriptions.¬†In fact, ProcessMaker‚Äôs AI can now take a business analyst from a text description to an end-to-end running process in just a few minutes.

We also spent time introducing our customer\'s to our latest solution - ProcessMaker Process Intelligence.  Process Intelligence is a new ProcessMaker offering thanks to the acquisition of Workfellow which we announced a few weeks ago.¬† 

I had not been to Nigeria in nearly six years due to a long COVID interruption.¬†It was great to be back.¬†I was reminded of the wonderful energy of Lagos, and the  good humor and incredible hospitality of Nigerians.¬† I am already looking forward to the event next year.  #bpm #workflowautomation #processintelligence #taskmining #processmining #idp #businessprocessmanagement #africa #innovateafrica #nigeria Fidelity Bank PLC Access Bank Plc Ecobank Cameroon Co-operative Bank of Kenya FSDH Merchant Bank Zenith Bank Plc UBA Group Heirs Technologies dipoleDIAMOND First Bank of Nigeria Ltd. ProvidusBank Optimus Bank FCMB Group #bankingnigeria #fintechnigeria',
